import Todo from "./Todo";

function Todos({ todos, filteredTodos, setTodos }) {
  return (
    <div className="todos">
      {filteredTodos.length > 0 ? filteredTodos.map(todo => (
          <Todo
            key={todo.id}
            todo={todo}
            todos={todos}
            setTodos={setTodos}
          />
      )) : <div style={{textAlign: "center"}}>There are no Todos</div>}
    </div>
   );
}

export default Todos;
